(5, 10, 0, 'About us', 'About us', '<p><span style=\"color: rgb(229, 228, 226); font-family: Lato, Calibri, Arial, sans-serif; font-size: 18px; text-align: justify;\">Since 2001, A2N has been providing software solutions for people with great ideas and for those needing assistance with software development. Not run-of-the-mill software development but our “skyrockets-our-clients-to-spectacular-success” software development. That is why we were awarded “Top Web & Software Developers, 2015” by Clutch and consistently rank in the Top. A2N started as a one-man band providing server administration services. Today we are 238 employees strong with five separate departments to help serve our ever-growing happy customer base with over 2,250 completed projects. We’ve grown because of our unique global ripple effect of word-of-mouth advertising by our satisfied customers from all over the world. </span><br style=\"color: rgb(229, 228, 226); font-family: Lato, Calibri, Arial, sans-serif; font-size: 18px; text-align: justify;\"><br style=\"color: rgb(229, 228, 226); font-family: Lato, Calibri, Arial, sans-serif; font-size: 18px; text-align: justify;\"><span style=\"color: rgb(229, 228, 226); font-family: Lato, Calibri, Arial, sans-serif; text-align: justify; font-size: 25px; font-weight: bold;\">\"We’re different—not peculiar different—but particular different. Being particular different means that you—our clients—benefit.\"</span><br></p>', '<p style=\"text-align: justify; \"><font color=\"#e5e4e2\" face=\"Lato, Calibri, Arial, sans-serif\"><span style=\"font-size: 18px;\">opkjplk</span></font></p>', 0, '', '', 0, '2017-05-10', 0, '2017-05-10', '');

